import React from 'react';
import ReactDOM from "react-dom";

function Home()
{
    return (
        <React.StrictMode>
            <container>
                <row>
            <h1>Search for products.</h1>
            <input placeholder='Enter producthunt link here' />
            </row>
            </container>
        </React.StrictMode>
    );
}
export default Home;
